tuple<int, int, double, double, double, double, double, double, double, double, double> explode(string const & s, char delim)
{
    vector<string> result;
    istringstream iss(s);

    for (string token; getline(iss, token, delim); )
        result.push_back(move(token));

    return make_tuple(stoi(result[0].substr(0, 6)), stoi(result[1]), stod(result[2]), stod(result[3]), stod(result[4]), stod(result[5]), stod(result[6]), stod(result[7]), stod(result[8]), stod(result[9]), stod(result[10]));
}

vector<tuple<int, int, double, double, double, double, double, double, double, double, double>> get_stock(string sc)
{
    vector<tuple<int, int, double, double, double, double, double, double, double, double, double>> history_data;
    ifstream fp("/home/kpr/stock/allstock/" + sc); //定义声明一个ifstream对象，指定文件路径
    string line;
    getline(fp,line); //跳过列名，第一行不做处理

    while (getline(fp, line))
    {
        history_data.push_back(explode(line, ','));
    }

    return history_data;
}

